                aria-labelledby="discrete-slider"
                getAriaValueText={valuetext}
                valueLabelDisplay="auto"
                step={1}
                marks
                min={1}
                max={5}
                onChangeCommitted={(e,value)=>setBody({...body,easyToUse:value})}
            />
           
        </FixedWidthDiv>
        <FixedWidthDiv>
            <div>How useful were the climate recommendations?</div>
            <Slider
                defaultValue={1}
                aria-labelledby="discrete-slider"
                getAriaValueText={valuetext}
                valueLabelDisplay="auto"
                step={1}
                marks
                min={1}
                max={5}
                onChangeCommitted={(e,value)=>setBody({...body,useful:value})}
            />
            
        </FixedWidthDiv>
        <FixedWidthDiv>
            <div>How accurate did the data and predictions seem to you?</div>
            <Slider
                defaultValue={1}
                aria-labelledby="discrete-slider"
                getAriaValueText={valuetext}
                valueLabelDisplay="auto"
                step={1}
                marks
                min={1}
                max={5}
                onChangeCommitted={(e,value)=>setBody({...body,accurate:value})}
            />
           
        </FixedWidthDiv>
        <FixedWidthDiv>
            <div>Do you have any suggestions for improvements?</div>
            <TextField fullWidth
            id="outlined-multiline-static"
            label="Suggestions"
            multiline
            rows={6}
            defaultValue=""
            variant="outlined"
            onChange={e=>setBody({...body,suggestions:e.target.value})}
            />
        </FixedWidthDiv>
        <FixedWidthDiv>
            <Button variant="contained" color="primary" onClick={handleSubmit}>
                Submit
            </Button>
        </FixedWidthDiv>
    </div>
)}

