padding-top:8px;
max-width:400px;
`

import React, {useState,useEffect} from 'react';
import Modal from '@material-ui/core/Modal';
import styled from '@emotion/styled'

const rand = () => Math.round(Math.random() * 20) - 10
  
const getModalStyle = () => {
    const top = 50 + rand();
    const left = 50 + rand();
  
    return {
      top: `${top}%`,
      left: `${left}%`,
      transform: `translate(-${top}%, -${left}%)`,
    }
  }

const apiKey = 'js-q3MeBwRzjGy2VyfXvAuvNLsbgHNmhOar1wbsMfwXjLXrHESUsC98Fgfzsq4mWATg'
export default ({open, handleClose, data,bestData}) => {
  const [distance,setDistance] = useState(0)
  const bestDataZip = bestData && bestData.zipcode
  const dataZip = data && data.zipcode
  useEffect(()=>{
   if (bestDataZip && dataZip) {
     fetch(`https://www.zipcodeapi.com/rest/${apiKey}/distance.json/${dataZip}/${bestDataZip}/mile`)
    .then(response => response.json())
    .then(data => data && setDistance(data.distance));
   }
  },[bestDataZip,dataZip])
  const [modalStyle] = React.useState(getModalStyle);
  const body = data ? (
    <StyledDiv style={modalStyle}>
      <h2 id="simple-modal-title">Climate Data</h2>
      <InfoDiv>
        Data is based on FIPS code, which includes the zipcode you entered.
      </InfoDiv>
      <div id="simple-modal-description">
        Climate Index: {Math.round(data.ClimateIndexAdjusted*100)/100}
      </div>
      <div id="simple-modal-description">
        Representative Zipcode: {data.zipcode}
      </div>
      <div id="simple-modal-description">
        Max Temperature: {Math.round(data.TMAX*100)/100}
      </div>
      <div id="simple-modal-description">
        Fire Likelihood: {data.Fire}
      </div>
      <div id="simple-modal-description">
        Flood Likelihood: {data.Flood}
      </div>
      {bestData && <><div id="simple-modal-description">
        Recommended New Climate Index: {Math.round(bestData.ClimateIndexAdjusted*100)/100}
      </div>
      <div id="simple-modal-description">
        Recommended New Zipcode: {bestData.zipcode}
      </div>
      <div id="simple-modal-description">
        Distance between zipcodes: {Math.round(100*distance)/100} miles
      </div></>}
    </StyledDiv>
  ) : <StyledDiv>
    No data available for this zipcode
  </StyledDiv>

  return (
      <Modal
        open={open}
        onClose={e=>handleClose(false)}
        aria-labelledby="simple-modal-title"
        aria-describedby="simple-modal-description"
      >
        {body}
      </Modal>
  );
}

const StyledDiv = styled.div`
position: absolute;
width: 400;
background-color: white;
border: 2px solid #000;
padding:12px; 
`

const InfoDiv = styled.div`
padding-bottom:8px; 
font-size: 16px; 
font-weight:bold;
`

import React, { useState } from "react"
import styled from '@emotion/styled'
import { ComposableMap, Geographies, Geography } from "react-simple-maps";
import { scaleQuantize } from "d3-scale";
import {useStaticQuery, graphql } from 'gatsby'
import DataModal from "./DataModal";
import Slider from '@material-ui/core/Slider'
import TextField from '@material-ui/core/TextField'
import Button from '@material-ui/core/Button'

export default () => {
const geoUrl = "https://cdn.jsdelivr.net/npm/us-atlas@3/counties-10m.json";

const colorScale = scaleQuantize()
  .domain([1, 6])
  .range([
    "#fdd0a2",
    "#fdae6b",
    "#fd8d3c",
    "#f16913",
    "#d94801",
    "#8c2d04",
  ]);


const graphQLData = useStaticQuery(graphql`
  query NOAAWeatherData {
    allNoaaWeatherCsv {
      nodes {
        PRCP
        SNOW
        SNWD
        TMAX
        TMIN
        TOBS
        year
        zipcode
        Fire
        FIPS
        ClimateIndexAdjusted
        Flood
      }
    }
  }
  `)
  const graphData = graphQLData.allNoaaWeatherCsv.nodes
  const [data, setData] = useState(graphData.filter(i=>i.year==="2030"))
  const [openModal,setOpenModal] = useState(false)
  const [modalInfo, setModalInfo] = useState('')
  const [zip,setZip] = useState('')
  const [bestData,setBestData]=useState('')
  const setModalData = (modalInfo,compare=false) => {
    console.log(compare)
    setModalInfo(modalInfo,compare?bestData:undefined)
    setOpenModal(true)
  }

  const valuetext=(value)=> {
    return `${value}`
  }
  const changeZip=(value)=> {
    if (value.length===5 && value!==zip){
      setZip(value)
      var subValue = value.substring(0,3)
      var lowZip = parseInt(subValue)-3
      var highZip = parseInt(subValue)+3
      var compareData=data.filter(i=>{
        var subZip = i.zipcode.substring(0,3)
        return subZip!==subValue && subZip>=lowZip && subZip<=highZip
      })
      const maxCompareData = compareData.reduce((prev, current)=> prev.ClimateIndexAdjusted > current.ClimateIndexAdjusted ? prev : current)
      setBestData(maxCompareData) 
    }
  }
  return (
  <>
  <YearDiv>
  <TextDiv> Select Year:</TextDiv>
    <SliderDiv><Slider
    defaultValue={2030}
    aria-labelledby="discrete-slider"
    getAriaValueText={valuetext}
    valueLabelDisplay="on"
    step={10}
    marks
    min={2030}
    max={2070}
    onChangeCommitted={(e,value)=>setData(graphData.filter(i=>+i.year===value))}
/></SliderDiv></YearDiv>
<YearDiv>
  <TextDiv>Enter Zipcode:</TextDiv>
    <SliderDiv width={70}>
    <TextField fullWidth
            id="outlined-multiline-static"
            label="Zipcode"
            defaultValue=""
            variant="outlined"
            onChange={e=>changeZip(e.target.value)}
            />
</SliderDiv></YearDiv>
<YearDiv>
  <Button variant="contained" color="primary" onClick={e=>setModalData(data.filter(i=>i.zipcode.substring(0,3)===zip.substring(0,3))[0],true)}>
    Show Data for this County!
  </Button>
</YearDiv>
      <ComposableMap projection="geoAlbersUsa">
        <Geographies geography={geoUrl}>
          {({ geographies }) =>
            geographies.map(geo => {
              const cur = data.find(s => s.FIPS === geo.id);
              return (
                <Geography
                  key={geo.rsmKey}
                  geography={geo}
                  fill={cur? colorScale(cur.ClimateIndexAdjusted) : "#D3D3D3"}
                  onClick={e=>cur && setModalData(cur)}
                />
              )
            })
        }
        </Geographies> 
        <DataModal open={openModal} data={modalInfo} handleClose={setOpenModal} bestData={bestData}/>
    </ComposableMap>  
    
    </> 
  )
}

const YearDiv = styled.div`
padding-top:8px;
width:50%;
display:flex; 
flex-direction: row; 
`
const TextDiv = styled.div`
padding-bottom:40px; 
`
const SliderDiv = styled.div`
padding-left:20px;
width:${p=>p.width?p.width:80}%;
`

import React from 'react';
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Box from '@material-ui/core/Box';
import Survey from './Survey'
import About from './About'
import WeatherMap from './WeatherMap';

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`simple-tabpanel-${index}`}
      aria-labelledby={`simple-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={4}>
          <div>{children}</div>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `simple-tab-${index}`,
    'aria-controls': `simple-tabpanel-${index}`,
  };
}

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    backgroundColor: theme.palette.background.paper,
  },
}));

export default function SimpleTabs() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div className={classes.root}>
      <AppBar position="static">
        <Tabs value={value} onChange={handleChange} aria-label="simple tabs example">
          <Tab label="Map" {...a11yProps(0)} />
          <Tab label="About" {...a11yProps(1)} />
          <Tab label="Feedback" {...a11yProps(2)} />
        </Tabs>
      </AppBar>
      <TabPanel value={value} index={0}>
        <WeatherMap/>
      </TabPanel>
      <TabPanel value={value} index={1}>
        <About/>
      </TabPanel>
      <TabPanel value={value} index={2}>
        <Survey/>
      </TabPanel>
    </div>
  );
}

